import React, { Component } from 'react';
import { ButtonContainer2 } from "./Button";

export default class Home extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <h1 className="col-12 text-title text-center home-title">FPBSD Summer Activity Center</h1>
                    </div>
                    <div className="gif col-6  row mx-auto"><iframe src="https://giphy.com/embed/l46CucCTE5duHKEla" width="480" height="267" frameBorder="0" allowFullScreen></iframe></div>
                    
                    
                <div className="row">

                </div>
            </div>
        )
    }
}
